using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// UIRotationGestureRecognizer is a concrete subclass of UIGestureRecognizer that looks for rotation gestures involving two touches. When the user moves the fingers opposite each other in a circular motion, the underlying view should rotate in a corresponding direction and speed.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIRotateGestureRecognizer_Class/index.html#//apple_ref/occ/cl/UIRotationGestureRecognizer"/>    [iOSVersion(3.2)]    [Export("")]    public class UIRotationGestureRecognizer : UIGestureRecognizer//, AnyObject, CVarArgType, Equatable, Hashable, NSObjectProtocol, Printable    {        public UIRotationGestureRecognizer() { }        /// <summary>        /// The rotation of the gesture in radians.        /// </summary>        [iOSVersion(3.2)]        [Export("rotation")]        public CGFloat Rotation { get; set; }                /// <summary>        /// The velocity of the rotation gesture in radians per second. (read-only)        /// </summary>        [iOSVersion(3.2)]        [Export("velocity")]        public CGFloat Velocity { get; private set; }    }}